import React from 'react';
import ReactDom from 'react-dom';
import Grouping from './Grouping';



function Tile(props){
    return <div className='tile'>
        <div className='atomicNum'>
            <p>{props.number}</p>
        </div>
        <div className='atomicSymbol'>
            <h1> {props.symbol}</h1>
        </div>
        <div className='atomicName'>
            <h2>{props.name}</h2>
        </div>
    </div>
    {
        if(prop.number == 1){
            console.log(props.name);
        }
    }
}



export default Tile;
